import {ReactComponents as SearchIcon} from "./ic-search.svg";
import {ReactComponents as CloseIcon} from "./ic-close-input.svg";




function Search() {
  return (
    <form className="search">
        <input type="text" className="search__input" placeholder="Поиск" />
        <button className="searc__button">
           <SearchIcon/>
           <CloseIcon/> 
        </button>
    </form>
  )
}


export default Search;
